  /// \8
  static const int RCL_LEXEME_BR8 = 16;

  /// \9
  static const int RCL_LEXEME_BR9 = 17;

  /// a name between slashes, must match (([a-zA-Z](_)?)|_)([0-9a-zA-Z](_)?)*
